function dd(e,o=0){let t=[];const n=" ".repeat(5*(o+1));if("object"==typeof e){for(let p in e)if(e.hasOwnProperty(p)){let s=e[p];"object"==typeof s?(t.push(`${n}'${p}' {\n`),t.push(dd(s,o+1)),t.push(`${n}}\n`)):t.push(`${n}'${p}' => "${s}"\n`)}}else t.push(`====> ${e} <=== (${typeof e})`);throw console.log(t.join("")),new Error("Execution halted by dd()")}